import React from 'react';

import classes from './Task.module.css';

	const Task = (props) => {

		return(
				<li id={props.id} className={classes.task}>
					<input 
						type="checkbox" 
						// onChange={(props.id) => (props.checkboxHandler(props.id))} 
						checked={props.checked}/>
					{props.text}
				</li>
			)
	}

export default Task;
